import { createElement as $, useState } from 'react';
import { Menu } from 'antd';
import { MailOutlined } from '@ant-design/icons';

const { SubMenu } = Menu;

const Header = () => {
	const [current, setCurrent] = useState('');

	const handleClick = (e) => {
		console.log('click ', e);
		setCurrent({ current: e.key });
	};

	return $(
		Menu,
		{
			onClick: () => handleClick(),
			selectedKeys: current,
			mode: 'horizontal',
		},
		$(Menu.Item, { key: 'mail', icon: MailOutlined }, 'Navigation One'),
		$(
			SubMenu,
			{ title: 'SubMenu', icon: MailOutlined },
			$(Menu.Item, { key: 'set1' }, 'Option One'),
			$(Menu.Item, { key: 'set2' }, 'Option Two')
		)
	);
};

export default Header;
